import styled from "styled-components";

export const Heading = styled.h1`
  text-align: right;
  color: #c5a880;
`;

export const Content = styled.div`
  overflowy: scroll;
  height: 2500px;
`;

export const Button = styled.div`
  position: fixed;
  right: 10px;
  bottom: 2.8rem;
  height: 20px;
  font-size: 2.5rem;
  z-index: 1;
  cursor: pointer;
  color: #c5a880;
`;
